    let myItems = this.state.originalitems;

    if (filterType === "noncompleted") {
      myItems = myItems.filter(item => !item.completed);
    }

    if (filterType === "completed") {
      myItems = myItems.filter(item => item.completed);
    }

    if (filterType === "expired") {
      myItems = myItems.filter(item => item.deadline < new Date());
    } // return {
    //     items: items
